description:
The love triangle continues -- on screen and off. Raquel and Buck are still having torrid romance, but she's starting to drift away. He tries to convince her he's a good man, and that they should be together. Does he? Will he? Can he? Perhaps. Will you get Racquel, Dyanna Lauren, Isis Nile, Asia Carrera and nymphet Tara Monroe absolutely naked and in your face? Definitely. The Revenge of Bonnie &amp; Clyde. Part 4. The final chapter. Over and out...with a bang.&quot;

